	(550, '2006-01-06 18:26:02', 2, '0000-00-00 00:00:00', '2006-01-06 18:26:02', 17, 1, 0, 'Hej Jan;\r\nSom netop aftalt pr. telefon oprettes hermed domænet bhardt.dk\r\nDet skal &quot;hægtes&quot; på samme webmail som sweethardt.dk, som herefter skal udgå.\r\nVenlig hilsen\r\n&quot;Frontoffice København&quot;\r\nHenning Bothmann (henning@bothmann.net)\r\nPS. Du må gerne kopiere mig på evt mail ', '1', 13613, '2006-01-06 18:26:02', 0, 0, 1, 1, 1, 0),
