	(565, '2006-01-13 11:56:59', 2, '0000-00-00 00:00:00', '2006-01-13 11:56:59', 11, 2, 0, 'Hej Jan,\r\n\r\nEndnu engang tak for hjælpen!\r\n\r\nJeg skal som aftalt ikke have flyttet domænet softinvestor.com, blot have oprettet webhotellet til nødstilfælde. Da jeg selv kan dirigere trafikken hvis der er problemer med vores egen server, kan jeg nøjes med at få serverens IP-adresse - så styrer jeg selv DNS-records.\r\n\r\nJeg vil meget gerne have opsat webhotellet på backup-internetforbindendelsen som du foreslog.\r\n\r\nGodt nytår og tak! ', '1', 13637, '2006-01-13 11:56:59', 0, 0, 0, 0, 1, 2),
