	(1574, '2007-07-15 22:01:50', 1, '0000-00-00 00:00:00', '2007-07-15 22:01:50', 19, 1, 0, 'Til orientering har hostmaster.dk sendt mig denne mail, som skal bruges i forbindelse med flytningen af domænenavnet dogedog.dk.\r\n\r\nKære Louise Lorenzen Vedr: dogedog.dk Tak for din henvendelse. For at redelegere/flytte et .dk domænenavn fra en internet-/webhotel-udbydertil en anden, skal du kontakte den nye udbyder. Den nye internet-/webhotel-udbyder bestiller domænet redelegeret via voreshjemmeside under Teknisk administration og Redelegerhttp://www.dk-hostmaster.dk/index.php?id=155 Når dette er bestilt, vil vi kort efter sende en e-mail til den e-mailadresseder er tilknyttet domænenavnet under fuldmægtig. I denne e-mail står der,hvordan redelegeringen godkendes via vores hjemmeside ved brug af bruger-id ogPINkode. Når redelegeringen er godkendt, vil domænenavnet blive flyttet i løbet af nogle timer. Når domænet er flyttet, kan der gå op til 24 timer før navneservice fordomænenavnet svarer korrekt fra den nye internet-/webhotel-udbyder. Med venlig hilsen / Best regards Michael Vinter DK Hostmaster A/S                  | Tel: +45 33 64 60 00Administrator of the DK TLD        | Fax: +45 33 64 60 01http://www.dk-hostmaster.dk  ', '1', 18821, '2007-07-15 22:01:50', 0, 0, 0, 0, 1, 0),
