	(2732, '2009-04-28 15:25:52', 1, '0000-00-00 00:00:00', '2009-04-28 15:25:52', 8, 1, 0, 'Jeg ønsker UltraMikroMail-hotel med den hertil knyttede mailadresse, se venligst nedenstående.Oplyst på mail fra Jer pr. d.d.\r\nMit domæne norgaard-kristensen.dk står hos CyberCity og ønskes flytte til Jer.\r\nDen e-mail adresse der er tilknyttet domænet er hc@norgaard-kristensen.dk og denne adresse bedes bibeholdt.\r\nJeg er ikke klar over hvad MSSQL og EAN kode er, hvorfor disse felter ikke er udfyldt.\r\nJeg fortsår I varetager flytning og jeg alene skal opsige hos CyberCity og bekræfte flytningen når hostmaster DK beder om det. \r\nTak for vejledning via mail og send ny, hvis fejl i min bestilling\r\nMVH HCNK ', '1', 24897, '2009-04-28 15:25:52', 0, 0, 0, 0, 1, 0),
